function isDate(str) {
    return !isNaN(Date.parse(str));
}

let csv = msg.payload;
let tide_list = {}
for (let x in csv){
    var tide = csv[x].col4;
    var date = String(csv[x].col6).replace(/\s/g, '');
    var dmy = date.split(".");
    var time = csv[x].col7;
    var timezone = String(csv[x].col11).replace(/\s/g, '');
    var d = new Date(dmy[2] + '/' + dmy[1] + '/' + dmy[0] + ' ' + time + ' GMT' + timezone);
    if (isDate(d)){ tide_list[String(d)] = tide };
}

msg.payload = d;

global.set("tide_list", tide_list);
return msg;

var max_sim_tide = 780 //in mm
var min_sim_tide = 100 //in mm (can be set to zero if needed)

let tide_list = global.get("tide_list")

var now = new Date();
now.setSeconds(0, 0);

for(let d in tide_list){

    var t = new Date(d);
    if (t > now){
        var last_tide = tide_list[last];
        var last_tide_time = new Date(last); 
        var next_tide = tide_list[d];
        var next_tide_time = t;
        break;
    }
    var last = d;
}

if (next_tide_time != null && last_tide_time != null){

    // prepare time diff in minutes between last and next tide (high or low)
    var tide_diff = (next_tide_time.getTime() - last_tide_time.getTime())/1000/60;

    // time diff in minutes between now and last tide(high or low) as X for sine calc
    var x = (now.getTime() - last_tide_time.getTime())/1000/60;
}

// Sine-factor to stretch sine curve over y axis according to max sim tide (minus the offset for min tide)
var sine_factor = (max_sim_tide - min_sim_tide) / 2;

// X-factor to stretch sine over x axis according to time diff of last+next tide (high or low)
var x_factor = 1 / (tide_diff / Math.PI);

// Y-Offset to move sine curve to min sim tide
var y_offset = sine_factor + min_sim_tide;

var y = null;

// Calculate current point in sine curve
if (next_tide == "H") { y = (sine_factor * Math.sin((x_factor * x) - (Math.PI / 2)) - y_offset).toFixed(0) };
if (next_tide == "N") { y = (sine_factor * Math.sin((x_factor * x) + (Math.PI / 2)) + y_offset).toFixed(0) };

msg.next_tide_time = next_tide_time;
msg.next_tide = next_tide;
msg.diff = tide_diff;
msg.current_diff = x;
msg.y_offset = y_offset;
msg.sine_factor = sine_factor;

msg.payload = [{"sine_tide": Number(y)}];
global.set("sine_tide", y);

if (y != null) { return msg; }

